import React from 'react';
import EditItem from './components/EditItem'
import { useNavigate } from "react-router-dom";
import Axios from 'axios';
import { models } from 'mongoose';
import { useParams } from 'react-router-dom';


function EditItemPage(props) {
  const navigate = useNavigate();

  const { id } = useParams();
  let currData; 
  Axios.get(`http://localhost:8080/pins/${id}`)
  .then(response => {
    const {name, img, description} = response.data;
    currData = {
      name: name,
      img: img,
      description: description
    }
  })
  .catch(error => console.log(error));

    const itemEditHandler = async function(itemData) {
        await Axios.put(`http://localhost:8080/pins/${id}`, itemData)
        .then(response => {})
        .catch(error => console.log(error));
        navigate('/loggedin')
    };

  return (
    <div>
        <EditItem currName={currData.name} currImg={currData.img} currDescription={currData.description} onEditItem={itemEditHandler} />
    </div>
  );
}

export default EditItemPage;
